import React from 'react';
import '../CSS/Homepage.css'

const Homepage = () => {
  return (
    <React.Fragment>
      <div class="menu-icon">
        <i class="fas fa-bars"></i>
      </div>
      <main>Homepage</main>
    </React.Fragment>
  );
};

export default Homepage;
